import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { CharactersComponent } from './characters/characters.component';



@NgModule({
  declarations: [
    CharactersComponent
  ],
  imports: [
    CommonModule
  ]
})
export class CharactersModule { }
